import zhMessages from "../locales/zh-Hans.json";

enMessages["sidebar.publisher"] = "Publisher";

const ZhLan = {
  messages: {
    ...zhMessages,
  },
  antd: null,
  locale: "zh-Hans-CN",
};
export default ZhLan;
